result:
ID: Conditional Output

Inputs:
- object
- propertyName
- value1
- value2
- value3

Outputs:
- output1
- output2
- output3
- defaultOutput

Completion Type: IMPLICIT

Reactive Inputs: None

Function:
```
function ({object, propertyName, value1, value2, value3}, {output1, output2, output3, defaultOutput}) {
  const propertyValue = object[propertyName];
  if (propertyValue === value1) {
    output1.next(object);
  } else if (propertyValue === value2) {
    output2.next(object);
  } else if (propertyValue === value3) {
    output3.next(object);
  } else {
    defaultOutput.next(object);
  }
}
```
